import React from 'react'
import { Parallax } from 'react-parallax'

const ParallaxEffect = () => {
  return (
    <>
      <h1>sdnsd</h1>
      <Parallax
        blur={10}
        bgImage='path/to/image.jpg'
        bgImageAlt='the cat'
        strength={200}
      >
        Content goes here. Parallax height grows with content height.
      </Parallax>
    </>
  )
}

export default ParallaxEffect
